import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import { useQueryClient } from 'react-query';
import { QUERY_KEYS } from '../../../consts/app-keys.const';
import { ITodo } from '../../../types/todo.types';

const StyledItem = styled.div`
  width: 100px;
  height: 100px;
  // margin: 0 auto;
  background: green;
  border: 1px solid black;
  text-align: center;
`;

const TodoTabletInner = () => {
  const queryClient = useQueryClient();

  const data = queryClient.getQueryData(QUERY_KEYS.TODOS);
  const todos = data?.data.todos;

  console.log(todos);
  const settings = {
    // dots: true,
    className: 'center',
    centerPadding: '60px',
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1
  };

  return (
    <div>
      <Slider {...settings}>
        <StyledItem>Slide1</StyledItem>
        <StyledItem>Slide2</StyledItem>
        <StyledItem>Slide3</StyledItem>
        <StyledItem>Slide4</StyledItem>
      </Slider>
    </div>
  );
};

export default TodoTabletInner;
